    "Are you sure you want to delete {email} from the library \u201c{container}\u201d?": "B\u1ea1n c\u00f3 ch\u1eafc ch\u1eafn mu\u1ed1n x\u00f3a {email} kh\u1ecfi th\u01b0 vi\u1ec7n \"{container}\" kh\u00f4ng?",
