    "Are you sure you want to remove this video from the list?": "B\u1ea1n c\u00f3 ch\u1eafc ch\u1eafn mu\u1ed1n x\u00f3a video n\u00e0y kh\u1ecfi danh s\u00e1ch kh\u00f4ng?",
    "Are you sure you want to restrict {email} access to \u201c{container}\u201d?": "B\u1ea1n c\u00f3 ch\u1eafc ch\u1eafn mu\u1ed1n gi\u1edbi h\u1ea1n {email} truy c\u1eadp v\u00e0o \u201c{container}\u201d?",
