    "Are you sure you want to unenroll from {courseName} ({courseNumber})?": "B\u1ea1n c\u00f3 ch\u1eafc ch\u1eafn mu\u1ed1n h\u1ee7y \u0111\u0103ng k\u00fd kh\u1ecfi  {courseName} ({courseNumber})?",
