    "Are you sure?": "B\u1ea1n c\u00f3 ch\u1eafc kh\u00f4ng?",
    "As part of the verification process, you take a photo of both your face and a government-issued photo ID. Our authorization service confirms your identity by comparing the photo you take with the photo on your ID.": "L\u00e0 m\u1ed9t ph\u1ea7n c\u1ee7a qu\u00e1 tr\u00ecnh x\u00e1c minh, b\u1ea1n c\u00f3 m\u1ed9t b\u1ee9c \u1ea3nh c\u1ee7a c\u1ea3 hai khu\u00f4n m\u1eb7t c\u1ee7a b\u1ea1n v\u00e0 m\u1ed9t ch\u00ednh ph\u1ee7 c\u1ea5p ID \u1ea3nh. D\u1ecbch v\u1ee5 \u1ee7y quy\u1ec1n c\u1ee7a ch\u00fang t\u00f4i x\u00e1c nh\u1eadn danh t\u00ednh c\u1ee7a b\u1ea1n b\u1eb1ng c\u00e1ch so s\u00e1nh c\u00e1c b\u1ee9c \u1ea3nh b\u1ea1n ch\u1ee5p v\u1edbi c\u00e1c b\u1ee9c \u1ea3nh tr\u00ean ID c\u1ee7a b\u1ea1n.",
    "As part of the verification process, you take a photo of both your face and a photo ID. Our authorization service confirms your identity by comparing the photo you take with the photo on your ID.": "Trong qu\u00e1 tr\u00ecnh x\u00e1c nh\u1eadn, b\u1ea1n c\u1ea7n ch\u1ee5p c\u1ea3 m\u1eb7t v\u00e0 \u1ea3nh c\u0103n c\u01b0\u1edbc. D\u1ecbch v\u1ee5 x\u00e1c minh c\u1ee7a ch\u00fang t\u00f4i x\u00e1c nh\u1eadn danh t\u00ednh c\u1ee7a b\u1ea1n b\u1eb1ng c\u00e1ch so s\u00e1nh \u1ea3nh ch\u1ee5p c\u1ee7a b\u1ea1n v\u1edbi \u1ea3nh b\u1ea1n tr\u00ean c\u0103n c\u01b0\u1edbc",
