    "The following message will be displayed at the bottom of the courseware pages within your course:": "Th\u00f4ng b\u00e1o sau s\u1ebd \u0111\u01b0\u1ee3c hi\u1ec3n th\u1ecb \u1edf d\u01b0\u1edbi c\u00f9ng c\u1ee7a c\u00e1c trang gi\u00e1o tr\u00ecnh kh\u00f3a h\u1ecdc c\u1ee7a b\u1ea1n:",
