    "There is invalid code in your content. Please check to make sure it is valid HTML.": "C\u00f3 m\u00e3 kh\u00f4ng h\u1ee3p l\u1ec7 trong n\u1ed9i dung c\u1ee7a b\u1ea1n. Vui l\u00f2ng ki\u1ec3m tra \u0111\u1ec3 ch\u1eafc ch\u1eafn r\u1eb1ng \u0111\u00f3 l\u00e0 HTML h\u1ee3p l\u1ec7.",
    "There is no email history for this course.": "Kh\u00f4ng c\u00f3 l\u1ecbch s\u1eed email c\u1ee7a kh\u00f3a h\u1ecdc n\u00e0y.",
