    "There was a problem creating the report. Select \"Create Executive Summary\" to try again.": "L\u1ed7i khi truy xu\u1ea5t b\u00e1o c\u00e1o. Ch\u1ecdn \"T\u1ea1o t\u00f3m t\u1eaft th\u1ef1c hi\u1ec7n\" \u0111\u1ec3 th\u1eed l\u1ea1i.",
    "There was an error changing the user's role": "X\u1ea3y ra l\u1ed7i khi thay \u0111\u1ed5i v\u1ecb tr\u00ed th\u00e0nh vi\u00ean",
