    "These settings include basic information about your account.": "Nh\u1eefng thi\u1ebft l\u1eadp n\u00e0y bao g\u1ed3m th\u00f4ng tin c\u01a1 b\u1ea3n v\u1ec1 t\u00e0i kho\u1ea3n c\u1ee7a b\u1ea1n.",
    "These users could not be added as beta testers because their accounts are not yet activated:": "Kh\u00f4ng th\u1ec3 th\u00eam nh\u1eefng ng\u01b0\u1eddi d\u00f9ng n\u00e0y l\u00e0m ng\u01b0\u1eddi ki\u1ec3m tra beta v\u00ec t\u00e0i kho\u1ea3n c\u1ee7a h\u1ecd ch\u01b0a \u0111\u01b0\u1ee3c k\u00edch ho\u1ea1t:",
