    "These users were not affiliated with the course so could not be unenrolled:": "Nh\u1eefng th\u00e0nh vi\u00ean sau kh\u00f4ng tham gia ch\u00ednh th\u1ee9c v\u1edbi kh\u00f3a h\u1ecdc n\u00ean kh\u00f4ng th\u1ec3 h\u1ee7y ghi danh:",
    "These users were not removed as beta testers:": "Nh\u1eefng th\u00e0nh vi\u00ean n\u00e0y kh\u00f4ng \u0111\u01b0\u1ee3c b\u1ecf kh\u1ecfi danh s\u00e1ch th\u00e0nh vi\u00ean b\u1ea3n th\u1eed nghi\u1ec7m:",
    "These users were successfully added as beta testers:": "Nh\u1eefng th\u00e0nh vi\u00ean n\u00e0y \u0111\u00e3 \u0111\u01b0\u1ee3c th\u00eam v\u00e0o danh s\u00e1ch th\u00e0nh vi\u00ean b\u1ea3n th\u1eed nghi\u1ec7m:",
    "These users were successfully removed as beta testers:": "Nh\u1eefng th\u00e0nh vi\u00ean n\u00e0y \u0111\u00e3 \u0111\u01b0\u1ee3c b\u1ecf kh\u1ecfi danh s\u00e1ch th\u00e0nh vi\u00ean b\u1ea3n th\u1eed nghi\u1ec7m:",
    "These users will be allowed to enroll once they register:": "Nh\u1eefng th\u00e0nh vi\u00ean n\u00e0y s\u1ebd \u0111\u01b0\u1ee3c ghi danh ngay sau khi \u0111\u0103ng k\u00fd:",
    "These users will be enrolled once they register:": "Nh\u1eefng th\u00e0nh vi\u00ean n\u00e0y s\u1ebd \u0111\u01b0\u1ee3c ghi danh ngay sau khi \u0111\u0103ng k\u00fd:",
