    "To access the course, select a session.": "\u0110\u1ec3 truy c\u1eadp kho\u00e1 h\u1ecdc, ch\u1ecdn m\u1ed9t phi\u00ean h\u1ecdc",
    "To be sure all students can access the video, we recommend providing both an .mp4 and a .webm version of your video. Click below to add a URL for another version. These URLs cannot be YouTube URLs. The first listed video that's compatible with the student's computer will play.": "\u0110\u1ec3 ch\u1eafc ch\u1eafn t\u1ea5t c\u1ea3 sinh vi\u00ean c\u00f3 th\u1ec3 truy c\u1eadp v\u00e0o video, ch\u00fang t\u00f4i khuy\u00ean b\u1ea1n n\u00ean cung c\u1ea5p c\u1ea3 phi\u00ean b\u1ea3n .mp4 v\u00e0 .webm video c\u1ee7a b\u1ea1n. B\u1ea5m v\u00e0o b\u00ean d\u01b0\u1edbi \u0111\u1ec3 th\u00eam m\u1ed9t URL cho m\u1ed9t phi\u00ean b\u1ea3n kh\u00e1c. Nh\u1eefng URL n\u00e0y kh\u00f4ng th\u1ec3 l\u00e0 URL tr\u00ean YouTube. Video \u0111\u1ea7u ti\u00ean \u0111\u01b0\u1ee3c li\u1ec7t k\u00ea t\u01b0\u01a1ng th\u00edch v\u1edbi m\u00e1y t\u00ednh c\u1ee7a h\u1ecdc sinh s\u1ebd \u0111\u01b0\u1ee3c ph\u00e1t.",
    "To continue learning with this account, sign in below.": "\u0110\u1ec3 ti\u1ebfp t\u1ee5c h\u1ecdc b\u1eb1ng t\u00e0i kho\u1ea3n n\u00e0y, \u0111\u0103ng nh\u1eadp d\u01b0\u1edbi \u0111\u00e2y",
    "To invalidate a certificate for a particular learner, add the username or email address below.": "\u0110\u1ec3 l\u00e0m m\u1ea5t hi\u1ec7u l\u1ef1c m\u1ed9t ch\u1ee9ng ch\u1ec9 c\u1ee7a m\u1ed9t ng\u01b0\u1eddi h\u1ecdc c\u1ee5 th\u1ec3, h\u00e3y th\u00eam t\u00ean ng\u01b0\u1eddi d\u00f9ng ho\u1eb7c \u0111\u1ecba ch\u1ec9 email d\u01b0\u1edbi \u0111\u00e2y.",
    "To receive a certificate, you must also verify your identity before {date}.": "\u0110\u1ec3 nh\u1eadn ch\u1ee9ng ch\u1ec9, b\u1ea1n c\u0169ng ph\u1ea3i x\u00e1c minh danh t\u00ednh c\u1ee7a m\u00ecnh tr\u01b0\u1edbc ng\u00e0y {date}.",
    "To receive a certificate, you must also verify your identity.": "\u0110\u1ec3 nh\u1eadn ch\u1ee9ng ch\u1ec9, b\u1ea1n c\u0169ng ph\u1ea3i x\u00e1c minh danh t\u00ednh c\u1ee7a m\u00ecnh.",
    "To receive credit for problems, you must select \"Submit\" for each problem before you select \"End My Exam\".": "\u0110\u1ec3 nh\u1eadn \u0111\u01b0\u1ee3c \u0111i\u1ec3m cho nh\u1eefng c\u00e2u h\u1ecfi, b\u1ea1n ph\u1ea3i ch\u1ecdn \"G\u1eedi\" cho m\u1ed7i c\u00e2u h\u1ecfi tr\u01b0\u1edbc khi b\u1ea1n ch\u1ecdn \"K\u1ebft th\u00fac B\u00e0i ki\u1ec3m tra C\u1ee7a t\u00f4i\".",
    "To review learner cohort assignments or see the results of uploading a CSV file, download course profile information or cohort results on the {link_start}Data Download{link_end} page.": "\u0110\u1ec3 xem l\u1ea1i b\u00e0i t\u1eadp c\u1ee7a nh\u00f3m h\u1ecdc vi\u00ean ho\u1eb7c xem k\u1ebft qu\u1ea3 t\u1ea3i l\u00ean t\u1ec7p tin CSV, h\u00e3y t\u1ea3i xu\u1ed1ng th\u00f4ng tin ti\u1ec3u s\u1eed kho\u00e1 h\u1ecdc ho\u1eb7c k\u1ebft qu\u1ea3 nh\u00f3m tr\u00ean trang {link_start}T\u1ea3i xu\u1ed1ng d\u1eef li\u1ec7u{link_end}.",
    "To share your certificate on Mozilla Backpack, you must first have a Backpack account. Complete the following steps to add your certificate to Backpack.": "\u0110\u1ec3 chia s\u1ebb ch\u1ee9ng ch\u1ec9 c\u1ee7a b\u1ea1n tr\u00ean Mozilla Backpack, tr\u01b0\u1edbc ti\u00ean b\u1ea1n ph\u1ea3i c\u00f3 m\u1ed9t t\u00e0i kho\u1ea3n Backpack. Ho\u00e0n t\u1ea5t c\u00e1c b\u01b0\u1edbc sau \u0111\u1ec3 th\u00eam gi\u1ea5y ch\u1ee9ng nh\u1eadn c\u1ee7a b\u1ea1n v\u00e0o Backpack.",
