    "We ask you to activate your account to ensure it is really you creating the account and to prevent fraud.": "Ch\u00fang t\u00f4i y\u00eau c\u1ea7u b\u1ea1n k\u00edch ho\u1ea1t t\u00e0i kho\u1ea3n c\u1ee7a b\u1ea1n \u0111\u1ec3 \u0111\u1ea3m b\u1ea3o n\u00f3 th\u1ef1c s\u1ef1 l\u00e0 b\u1ea1n \u0111ang t\u1ea1o t\u00e0i kho\u1ea3n v\u00e0 \u0111\u1ec3 tr\u00e1nh gian l\u1eadn.",
    "We couldn't create your account.": "Ch\u00fang t\u00f4i kh\u00f4ng th\u1ec3 t\u1ea1o ra t\u00e0i kho\u1ea3n c\u1ee7a b\u1ea1n.",
    "We couldn't find any results for \"%s\".": "Kh\u00f4ng th\u1ec3 t\u00ecm th\u1ea5y k\u1ebft qu\u1ea3 cho \"%s\".",
    "We couldn't sign you in.": "Ch\u00fang t\u00f4i kh\u00f4ng th\u1ec3 \u0111\u0103ng nh\u1eadp cho b\u1ea1n.",
    "We have encountered an error. Refresh your browser and then try again.": "\u0110\u00e3 ph\u00e1t hi\u1ec7n l\u1ed7i. L\u00e0m m\u1edbi l\u1ea1i tr\u00ecnh duy\u1ec7t c\u1ee7a b\u1ea1n r\u1ed3i th\u1eed l\u1ea1i.",
    "We have received your information and are verifying your identity. You will see a message on your dashboard when the verification process is complete (usually within 5-7 days). In the meantime, you can still access all available course content.": "Ch\u00fang t\u00f4i \u0111\u00e3 nh\u1eadn \u0111\u01b0\u1ee3c th\u00f4ng tin v\u00e0 \u0111ang x\u00e1c minh danh t\u00ednh c\u1ee7a b\u1ea1n. B\u1ea1n s\u1ebd nh\u1eadn \u0111\u01b0\u1ee3c m\u1ed9t tin nh\u1eafn tr\u00ean b\u1ea3ng tin khi qu\u00e1 tr\u00ecnh n\u00e0y ho\u00e0n t\u1ea5t (kho\u1ea3ng 5-7 ng\u00e0y). Trong l\u00fac \u0111\u00f3, b\u1ea1n v\u1eabn c\u00f3 th\u1ec3 truy c\u1eadp v\u00e0o to\u00e0n b\u1ed9 n\u1ed9i dung kho\u00e1 h\u1ecdc.",
    "We just need a little more information before you start learning with %(platformName)s.": "Ch\u00fang t\u00f4i ch\u1ec9 c\u1ea7n th\u00eam m\u1ed9t ch\u00fat th\u00f4ng tin tr\u01b0\u1edbc khi b\u1ea1n b\u1eaft \u0111\u1ea7u h\u1ecdc v\u1edbi %(platformName)s.",
    "We securely encrypt your photo and send it to our authorization service for review. Your photo and information are not saved or visible anywhere on %(platformName)s after the verification process is complete.": "Ch\u00fang t\u00f4i m\u00e3 ho\u00e1 \u1ea3nh c\u1ee7a b\u1ea1n m\u1ed9t c\u00e1ch b\u1ea3o m\u1eadt v\u00e0 g\u1eedi t\u1edbi d\u1ecbch v\u1ee5 c\u1ea5p ph\u00e9p \u0111\u1ec3 \u0111\u00e1nh gi\u00e1. \u1ea2nh v\u00e0 th\u00f4ng tin c\u00e1 nh\u00e2n c\u1ee7a b\u1ea1n s\u1ebd kh\u00f4ng \u0111\u01b0\u1ee3c l\u01b0u hay hi\u1ec3n th\u1ecb \u1edf b\u1ea5t c\u1ee9 \u0111\u00e2u tr\u00ean %(platformName)s sau khi qu\u00e1 tr\u00ecnh x\u00e1c minh ho\u00e0n t\u1ea5t.",
    "We use the highest levels of security available to encrypt your photo and send it to our authorization service for review. Your photo and information are not saved or visible anywhere on %(platformName)s after the verification process is complete.": "Ch\u00fang t\u00f4i s\u1eed d\u1ee5ng c\u00e1c m\u1ee9c b\u1ea3o m\u1eadt cao nh\u1ea5t c\u00f3 s\u1eb5n \u0111\u1ec3 m\u00e3 h\u00f3a h\u00ecnh \u1ea3nh c\u1ee7a b\u1ea1n v\u00e0 g\u1eedi n\u00f3 \u0111\u1ebfn d\u1ecbch v\u1ee5 \u1ee7y quy\u1ec1n c\u1ee7a ch\u00fang t\u00f4i \u0111\u1ec3 xem x\u00e9t. \u1ea2nh v\u00e0 th\u00f4ng tin c\u1ee7a b\u1ea1n s\u1ebd kh\u00f4ng \u0111\u01b0\u1ee3c l\u01b0u hay b\u1ea5t c\u1ee9 n\u01a1i n\u00e0o c\u00f3 th\u1ec3 nh\u00ecn th\u1ea5y tr\u00ean %(platformName)s sau khi qu\u00e1 tr\u00ecnh x\u00e1c minh ho\u00e0n t\u1ea5t.",
    "We use your verification photos to confirm your identity and ensure the validity of your certificate.": "Ch\u00fang t\u00f4i s\u1eed d\u1ee5ng \u1ea3nh c\u1ee7a b\u1ea1n \u0111\u1ec3 x\u00e1c minh danh t\u00ednh c\u1ee7a b\u1ea1n v\u00e0 \u0111\u1ea3m b\u1ea3o r\u1eb1ng B\u1eb1ng khen c\u1ee7a b\u1ea1n s\u1ebd c\u00f3 hi\u1ec7u l\u1ef1c",
    "We're sorry to see you go! Your account will be deleted shortly.": "Ch\u00fang t\u00f4i r\u1ea5t ti\u1ebfc khi th\u1ea5y b\u1ea1n ra \u0111i! T\u00e0i kho\u1ea3n c\u1ee7a b\u1ea1n s\u1ebd \u0111\u01b0\u1ee3c x\u00f3a ngay.",
    "We're sorry, there was an error": "R\u1ea5t ti\u1ebfc, c\u00f3 l\u1ed7i x\u1ea3y ra",
