    "You can pay now even if you don't have the following items available, but you will need to have these by {date} to qualify to earn a Verified Certificate.": "B\u1ea1n c\u00f3 th\u1ec3 thanh to\u00e1n ngay b\u00e2y gi\u1edd ngay c\u1ea3 khi b\u1ea1n kh\u00f4ng c\u00f3 c\u00e1c m\u1ee5c sau \u0111\u00e2y nh\u01b0ng b\u1ea1n s\u1ebd c\u1ea7n ph\u1ea3i c\u00f3 nh\u1eefng th\u00f4ng tin n\u00e0y v\u00e0o ng\u00e0y {date} \u0111\u1ec3 h\u1ed9i \u0111\u1ee7 \u0111i\u1ec1u ki\u1ec7n \u0111\u1ec3 l\u1ea5y Ch\u1ee9ng ch\u1ec9 X\u00e1c nh\u1eadn.",
    "You can pay now even if you don't have the following items available, but you will need to have these to qualify to earn a Verified Certificate.": "B\u1ea1n c\u00f3 th\u1ec3 thanh to\u00e1n ngay t\u1ea1i ngay c\u1ea3 khi b\u1ea1n kh\u00f4ng c\u00f3 c\u00e1c m\u1ee5c sau \u0111\u00e2y c\u00f3 s\u1eb5n, nh\u01b0ng b\u1ea1n s\u1ebd c\u1ea7n ph\u1ea3i c\u00f3 nh\u1eefng h\u1ed9i \u0111\u1ee7 \u0111i\u1ec1u ki\u1ec7n \u0111\u1ec3 ki\u1ebfm \u0111\u01b0\u1ee3c m\u1ed9t gi\u1ea5y ch\u1ee9ng nh\u1eadn Verified.",
